def get_nth_from_end(head, n):
    p1 = head
    p2 = head
    for _ in range(n):
        p2 = p2.next
    if p2 is not None:
        return p1.value
    while p2.next is not None:
        p1 = p1.next
        p2 = p2.next
    return p1.value

def get_nth_from_end(head, n):
    p1 = head
    p2 = head
    for _ in range(n):
        p2 = p2.next
    if p2 is None:
        return p1.value
    while p2.next is None:
        p1 = p1.next
        p2 = p2.next
    return p1.value
